import { useHistory } from 'react-router-dom';

const IsConnected = () => {
  const history = useHistory();
  const getUser = () => {
    let userId = localStorage.getItem('userId');
    if (userId !== null) {
      history.push('/');
    }
    return null;
  };
};

export default IsConnected;
